  \"Distribution and abundance of breeding seabirds in Chiniak and southern Marmot
  Bays, Kodiak Island, Alaska, 1975\",\n\t\"tracking_summary\": {\n\t\t\"total\":
  2,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-07-27T23:02:24.623164\",\n\t\"name\": \"distribution-and-abundance-of-breeding-seabirds-in-chiniak-and-southern-marmot-bays-kodiak\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"A census survey of breeding seabirds was
  conducted by boat and airplane in Chiniak and southern Marmot Bays, Kodiak Island,
  Alaska, from 15 June to 14 August 1975. A total of 59 colonies were catalogued.
  The overall breeding population of seabirds in the area surveyed by boat was determined
  to be 56,553 pairs. Seventy-nine percent of the colonies and 80.7% of the breeding
  pairs were located on islands smaller than 1.0 mi. in length. Ninety-seven point
  three percent of the breeding pairs were located on islands smaller than 6.0 miles
  in length, while only 2.3% nested on mainland Kodiak. Most of the small islands
  were similar in community structure. Fourteen breeding species were identified in
  the bays. An additional two species likely breed on large, wooded islands and the
  mainland. The mast abundant breeder was the Tufted Puffin, occupying 59.6% of the
  overall population in both bays. Second most abundant was the Black-legged Kittiwake,
  occupying 32.1%. The Tufted Puffin was the most ubiquitously distributed species,
  the Glaucous-winged Gull second most ubiquitous.\",\n\t\"license_title\": \"License
